INSERT INTO `docdesc` (`descid`, `Userid`, `description`, `specialist`, `degrees`) VALUES
(1, '1', ' ASHIK ASHRAFE has over 40000 Coronary Angiograms and over 5000 Angioplasties he did individually at Ibrahim Cardiac Hospital in between early 2003 to early 2012. He assisted over 5000 Coronary Angioplasties, over 200 Carotid and Ilio-femoral angioplasties and 700 Permanent Pacemaker Implantation and about 50 AICD and biventricular pacemakers. Dr. Mahbub implanted over more than 300 permanent pacemakers, 30 CRTs and ICDs. Before Joining Square Hospital, Associate Professor Dr. Mahbub worked as Chief Cardiologist, CCU and Cathlab In-charge at Ibn Sina Specialized Hospital. He executed more than 8000 intervention procedures and implanted more than 100 PPM and other cardiac devices in a period of four years at Ibn Sina. Dr. Mahbub Mansur is specialized in right heart catheterization, diagnostic coronary angiogram & angioplasties (PTCA), renal angiogram and angioplasties, carotid angiogram, peripheral angiogram and angioplasties, balloon valvuloplasties, permanent pacemakers, AICD and Bi-Ventricular pacemaker i', 'Cardiologist', 'MBBS, MD (Cardiology) Fellow Interventional Cardiology Fellow pacing, EP & device implantation'),
